<?php
    header("Content-type: text/html; charset=utf-8");

    include_once('admin/includes/connections.php');

    $sql = "
    SELECT 
      A.cidade              AS cidade,
      A.cep                 AS cep,
      A.endereco            AS endereco,
      A.numeroender         AS numeroender,
      A.telefone            AS telefone,
      A.ddd                 AS ddd,
      A.telefone_celular    AS telefone_celular,
      A.ddd_celular         AS ddd_celular,
      A.logra               AS logra,
      A.bairro              AS bairro,
      B.apelido				      AS apelido,
      B.ddd_cel				      AS ddd_celular_vendedor,	
      B.nro_celular			    AS telefone_celular_vendedor,
      B.cod_emp             AS cod_emp
    FROM 
      web_cidade A,
      in_sistema_colaboradoresativos B
    WHERE 1=1
    AND A.cod_emp = B.cod_emp
    AND A.status = 'S'
    AND B.status = 'S'
    ORDER BY 
      A.cidade
    ";
    // echo '<pre>' . $sql . '</pre>'; exit;
    $tot_itens=0;
    $stmt = $pdo->query($sql);
    while($row_cidades = $stmt->fetch()){
      if($cod_emp != $row_cidades['cod_emp']){
        $arr_dados['descr'][$tot_itens]               = $row_cidades['descricao'];
        $arr_dados['cidade'][$tot_itens]              = $row_cidades['cidade'];
        $arr_dados['cep'][$tot_itens]                 = $row_cidades['cep'];
        $arr_dados['endereco'][$tot_itens]            = $row_cidades['endereco'];
        $arr_dados['num_end'][$tot_itens]             = $row_cidades['numeroender'];
        $arr_dados['telefones'][$tot_itens]           = $row_cidades['telefone'];
        $arr_dados['ddd'][$tot_itens]                 = $row_cidades['ddd'];
        $arr_dados['logra'][$tot_itens]               = $row_cidades['logra'];
        $arr_dados['razao'][$tot_itens]               = $row_cidades['razao'];
        $arr_dados['bairro'][$tot_itens]              = $row_cidades['bairro'];
        $arr_dados['cod_emp'][$tot_itens]             = $row_cidades['cod_emp'];
        $arr_dados['telefone_celular'][$tot_itens]    = $row_cidades['telefone_celular'];
        $arr_dados['ddd_celular'][$tot_itens]         = $row_cidades['ddd_celular'];
        $tot_itens++;
      }

      $arr_dados['vendedores'][$row_cidades['cod_emp']]['apelido'][]           = $row_cidades['apelido'];
      $arr_dados['vendedores'][$row_cidades['cod_emp']]['telefone_celular'][]  = $row_cidades['telefone_celular_vendedor'];
      $arr_dados['vendedores'][$row_cidades['cod_emp']]['ddd_celular'][]       = $row_cidades['ddd_celular_vendedor'];

      $cod_emp = $row_cidades['cod_emp'];
    }

